* Material Dashboard 2 React - v2.2.0
=========================================================

* Product Page: https://www.creative-tim.com/product/material-dashboard-react
* Copyright 2023 Creative Tim (https://www.creative-tim.com)

Coded by www.creative-tim.com

 =========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.
*/

import { useState,useEffect } from "react";

// @mui material components
import Card from "@mui/material/Card";
import Icon from "@mui/material/Icon";
import Menu from "@mui/material/Menu";
import MenuItem from "@mui/material/MenuItem";
import axios from "axios"

// Material Dashboard 2 React components
import MDBox from "components/MDBox";
import MDTypography from "components/MDTypography";

// Material Dashboard 2 React examples
import DataTable from "examples/Tables/DataTable";

// Data
import data from "layouts/dashboard/components/Projects/data";

function Projects() {
  const { columns, rows } = data();
  const [menu, setMenu] = useState(null);

  useEffect(()=>{fetchService()},[])
  const fetchService = ()=>{



    // fetch('https://mockbin.org/bin/684bac23-9896-4941-b572-3c4be72fa26f', {
    //   mode: 'no-cors',
    //   method: "get",
    //   headers: {
    //     "Content-Type": "application/json"
    //   }
    // })
    //   .then((res)=>{
    //     console.log(res)
    //     //const resjson = json.parse(resjson)
    //     //console.log(resjson)
    //   })




  }

  useEffect(() => {
    axios
      .get(`https://mockbin.org/bin/684bac23-9896-4941-b572-3c4be72fa26f/`)
      .then((resp) => {
        console.log("resp", resp);
        const data = resp.data;
        const content = data.content;
        console.log("content", content);
        const text = content.text;
        console.log("text", text);
        const datajson = JSON.parse(text);
        console.log("datajson",datajson)
        setMenu(text)
      })
      .catch(function (error) {
        console.log(error);
      });
  }, []);

  const openMenu = ({ currentTarget }) => setMenu(currentTarget);
  const closeMenu = () => setMenu(null);

  const renderMenu = (
    <Menu
      id="simple-menu"
      anchorEl={menu}
      anchorOrigin={{
        vertical: "top",
        horizontal: "left",
      }}
      transformOrigin={{
        vertical: "top",
        horizontal: "right",
      }}
      open={Boolean(menu)}
      onClose={closeMenu}
    >

      <MenuItem onClick={closeMenu}>Action</MenuItem>
      <MenuItem onClick={closeMenu}>Another action</MenuItem>
      <MenuItem onClick={closeMenu}>Something else</MenuItem>
    </Menu>
  );

  return (
    <Card>
      <MDBox display="flex" justifyContent="space-between" alignItems="center" p={3}>
        <MDBox>
          <MDTypography variant="h6" gutterBottom>
            Service Details
          </MDTypography>
        </MDBox>
        <Menu
          id="simple-menu"
          anchorEl={menu}
          anchorOrigin={{
            vertical: "top",
            horizontal: "left",
          }}
          transformOrigin={{
            vertical: "top",
            horizontal: "right",
          }}
          open={Boolean(menu)}
          onClose={closeMenu}
        >
          {menu.map((item)=>{
            return(
              <>
                <MenuItem onClick={closeMenu}>{item.service}</MenuItem>
              </>
            )
          })}

        </Menu>
      </MDBox>
      <MDBox>
        <DataTable
          table={{ columns, rows }}
          showTotalEntries={false}
          isSorted={false}
          noEndBorder
          entriesPerPage={false}
        />
      </MDBox>
    </Card>
  );
}

export default Projects;
